import React from 'react'
import { useParams } from 'react-router-dom'
import './Chat.css'

function Chat() {
    const { roomId } = useParams()
    return (
      <div className='chat'>
        <h2>Your Are In {roomId} Chat Room</h2>
      </div>
    );
}

export default Chat
